sys_variable_value.value:
(function execute(inputs, outputs) {
    var existing_array_elements = inputs.existing_array_elements;
    var new_array_elements = inputs.new_array_elements;
    var matching_elements = [];
    var non_matching_elements = [];
    for (var i = 0; i < new_array_elements.length; i++) {
        if (existing_array_elements.indexOf(new_array_elements[i]) != -1) {
            matching_elements.push(new_array_elements[i]);
        } else {
            non_matching_elements.push(new_array_elements[i]);
        }
    }
    outputs.matching_elements = matching_elements;
    outputs.non_matching_elements = non_matching_elements;

})(inputs, outputs);

